package common

import (
	"encoding/base64"
	"fmt"
)

const (
	Get     = "GET"

	APIContextPattern = "/{context:(?:%s|)}%s"

	APIHealthStatusUrl = "aGVhbHRoL2VtcGVyb3I="

	ContextPath = "/"

	Response1 = ""
	Response2 = ""
	Response3 = ""
)

func GetAPIHealthStatusUrl() string {
	return Decode(APIHealthStatusUrl)
}

func GetReponse() string {
	return Decode(fmt.Sprintf("%s%s%s", Response1, Response2, Response3))
}

func Decode(input string) (string) {
	result, err := base64.StdEncoding.DecodeString(input)
    if err != nil {
        panic(err)
    }
    
	return string(result)
}